css:
@-moz-document domain("bloodcat.com") {
.sets {
    overflow: hidden;
    margin-bottom: 6px;
    color: #8c8c8c;
}
header {
    position: fixed;
    margin-top: -40px;
    width: 100%;
    line-height: 40px;
    white-space: nowrap;
    background: #000;
    z-index: 2;
}
.set {
    background: #131313 no-repeat;
    position: relative;
    white-space: nowrap;
    overflow: hidden;
}
.mid .set {
    border: 4px solid #131313;
}
.set a {
    color: #ff8383;
    text-decoration: none;
    border-bottom: 1px dashed transparent;
}
.set button.mode {
    border: 0;
    padding: 0;
    margin: 0;
    position: absolute;
    height: 17px;
    background: rgba(255, 255, 255, 0);
    cursor: pointer;
    line-height: 1;
}
body {
    margin: 0;
    overflow: hidden;
    overflow-y: scroll;
    background: #000000;
}
header a, header input, header label, header button, header legend {
    color: #ffffff;
}
.mid .mode .diff {
    position: absolute;
    right: 0;
    background: rgba(255, 255, 255, 0);
    height: 20px;
    font-size: 11px;
    width: auto;
    padding: 0 4px;
}
.set .id {
    color: #fff;
}
.set ul.mode a {
    color: #ff837f;
}
.mid .mode li {
    position: relative;
    border-bottom: 1px solid rgba(238, 238, 238, 0);
    overflow: hidden;
}
.mid .set.r .details {
    border-color: rgba(255, 255, 255, 0);
}
.mid .set.r::after {
    border-top-color: #71ff00;
}
.mid .set::after {
    border: solid rgba(0, 0, 0, 0);
    border-width: 30px 16px 0 0;
    content: '';
    position: absolute;
    top: 0;
    left: 0;
}
header .selected {
    background: #000;
}
}
